import { MDBDataTableV5 } from 'mdbreact';

export default function App() {
  const [datatable, setDatatable] = React.useState({
    columns: [
      {
        label: 'Source',
        field: 'source',
        width: 150,
        attributes: {
          'aria-controls': 'DataTable',
          'aria-label': 'Source',
        },
      },
      {
        label: 'Funding Name',
        field: 'funding_name',
        width: 270,
      },
      {
        label: 'Purpose Of Funding',
        field: 'purpose',
        width: 200,
      },
      {
        label: 'Max Grant Amount',
        field: 'max',
        sort: 'asc',
        width: 50,
      },
      {
        label: 'Eligibility Requirements',
        field: 'E_R',
        width: 150,
      },
      {
        label: 'Deadline',
        field: 'deadline',
        width: 100,
      },
      {
        label: 'Contact Person',
        field: 'contact',
        width: 100
      }, 
      {
        label: 'Physical Location',
        field: 'location',
        width: 100
      },
      {
        label: 'Web Address',
        field: 'web',
        width: 100
      }
    ],
    rows: [
      {

      }
    ],
  });

  return (
    <MDBDataTableV5
      hover
      entriesOptions={[5, 20, 25]}
      entries={5}
      pagesAmount={4}
      data={datatable}
      pagingTop
      searchTop
      searchBottom={false}
    />
  );
}
